export const FetchProjects = () => new Promise((resolve, reject) => {
    fetch('http://localhost:9000/projects')
    .then((response) => {
        resolve(response.json())
    })
    .catch((error) => {
        reject(error)
    })
})

export const PostProject = (projectname, description) => new Promise((resolve, reject) => {
    fetch({
        method: 'POST',
        path: 'http://localhost:9000/projects/addProject',
        body: {
            projectname,
            description
        },
    })
    .then((response) => {
        resolve(response.json())
    })
    .catch((error) => {
        console.log("ERROR", error)
        reject(error)
    })
})
